    try:
        radiocarbon_data = pd.read_excel(file_path)
        return radiocarbon_data
    except Exception as e:
        print(f"Error loading radiocarbon data: {e}")

# Merge the wet-dry index data and year data into a single dataframe.
def merge_data(climate_data, radiocarbon_data):
    try:
        # Assuming the year column is named 'Year' in both dataframes
        merged_data = pd.merge(climate_data, radiocarbon_data, on='Year')
        return merged_data
    except Exception as e:
        print(f"Error merging data: {e}")

# Calculate the percent of years the wet-dry index was increasing.
