    try:
        # Assuming the wet-dry index column is named 'Wet-Dry Index' in the merged dataframe
        increasing_years = merged_data['Wet-Dry Index'].diff().gt(0).sum()
        total_years = len(merged_data)
        increasing_percent = (increasing_years / total_years) * 100
        return round(increasing_percent, 2)
    except Exception as e:
        print(f"Error calculating increasing percent: {e}")

