import json
import pandas as pd

# Subtask 1: Read the climateMeasurements.xlsx file and convert it into a pandas DataFrame
def read_data(file_path):
    try:
        data = pd.read_excel(file_path)
        return data
    except Exception as e:
        print(f"Error reading file: {e}")

# Subtask 2: Sort the DataFrame by years and calculate the difference in wet-dry index between consecutive years
def sort_and_calculate_diff(data):
    try:
        data['Year'] = pd.to_numeric(data['Year'], errors='coerce')
        data.sort_values(by='Year', inplace=True)
        data['Wet-Dry Index Diff'] = data['Wet-Dry Index'].diff()
        return data
    except Exception as e:
        print(f"Error sorting and calculating difference: {e}")

# Subtask 3: Mark the years where the wet-dry index increased compared to the previous year
def mark_increased_years(data):
    try:
        data['Increased'] = data['Wet-Dry Index Diff'].apply(lambda x: 1 if x > 0 else 0)
        return data
    except Exception as e:
        print(f"Error marking increased years: {e}")

# Subtask 4: Calculate the percentage of years where the wet-dry index increased
def calculate_percentage(data):
    try:
        increased_years = data['Increased'].sum()
        total_years = len(data)
        percentage = (increased_years / total_years) * 100
        return round(percentage, 2)
    except Exception as e:
        print(f"Error calculating percentage: {e}")

# Main task
def main():
    file_path = '/orcd/home/002/gerarvit/Kramabench/data/archeology/input/climateMeasurements.xlsx'
    data = read_data(file_path)
    data = sort_and_calculate_diff(data)
    data = mark_increased_years(data)
    percentage = calculate_percentage(data)

    print(json.dumps({
        "subtask-1": "Data read successfully",
        "subtask-2": "Data sorted and difference calculated successfully",
        "subtask-3": "Increased years marked successfully",
        "subtask-4": "Percentage calculated successfully",
        "main-task": percentage
    }, indent=4))

if __name__ == "__main__":
