import json
import pandas as pd

# Load the worldcities.csv file into a pandas DataFrame
def load_data(file_path):
    try:
        data = pd.read_csv(file_path)
        return data
    except Exception as e:
        print(f"Error loading data: {e}")

# Filter the DataFrame to only include primary capitals
def filter_primary_capitals(data):
    try:
        primary_capitals = data[data['capital'] == 'primary']
        return primary_capitals
    except Exception as e:
        print(f"Error filtering primary capitals: {e}")

# Group the DataFrame by country and find the primary capital with the largest population
def get_largest_primary_capital(primary_capitals):
    try:
        largest_primary_capitals = primary_capitals.loc[primary_capitals.groupby('country')['population'].idxmax()]
        return largest_primary_capitals
    except Exception as e:
        print(f"Error getting largest primary capitals: {e}")

# Calculate the average latitude of the primary capitals with the largest population
def calculate_average_latitude(largest_primary_capitals):
    try:
        average_latitude = largest_primary_capitals['lat'].mean()
        return round(average_latitude, 4)
    except Exception as e:
        print(f"Error calculating average latitude: {e}")

# Get unique country names matching for the primary capitals
def get_unique_country_names(primary_capitals):
    try:
        unique_country_names = primary_capitals['country'].unique()
        return unique_country_names
    except Exception as e:
        print(f"Error getting unique country names: {e}")

# Main function
def main():
    file_path = '/orcd/home/002/gerarvit/Kramabench/data/archeology/input/worldcities.csv'
    data = load_data(file_path)
    primary_capitals = filter_primary_capitals(data)
    largest_primary_capitals = get_largest_primary_capital(primary_capitals)
    average_latitude = calculate_average_latitude(largest_primary_capitals)
    unique_country_names = get_unique_country_names(primary_capitals)

    print(json.dumps({
        "subtask-1": "Data loaded successfully",
        "subtask-2": "Primary capitals filtered successfully",
        "subtask-3": "Largest primary capitals found successfully",
        "subtask-4": "Average latitude calculated successfully",
        "main-task": {
            "average_latitude": average_latitude,
            "unique_country_names": unique_country_names.tolist()
        }
    }, indent=4))

if __name__ == "__main__":
    main()
